import React from 'react';
import { Card, CardContent, CardMedia, Typography, Grid,Button } from '@mui/material';
import image from './images.jpg'
import image2 from './download.jpg'

const PatientCard = ({ name, dob, disease, value, image }) => {
  return (
    <div style={{background:""}}>
    <Card sx={{ maxWidth: 545 }} style={{height:"500px",width:"700px",marginLeft:"600px",background:"pink"}}>
      <Grid container>
        <Grid item xs={4}>
          <CardMedia
            component="img"
            height="140"
            image={image2}
            alt={name}
          />
        </Grid>
        <Grid item xs={8}>
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
              {name}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Date of Birth: {dob}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Disease: {disease}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Value: {value}
            </Typography>
          </CardContent>
        </Grid>
      </Grid>
    </Card>
    </div>
  );
};

const LandingPage = () => {
  return (
    <div>
      <h1>Patient</h1>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6} md={4}>
          <PatientCard
            name="John Doe"
            dob="01/01/1990"
            disease="Flu"
            value="Normal"
            image="https://via.placeholder.com/150"
          />
        </Grid>
       
        {/* Add more PatientCard components as needed */}
      </Grid>

      <Button style={{marginLeft:"600px"}} variant='contained'>Prescripition</Button>
    </div>
  );
};

export default LandingPage;
